/* harmony default export */ __webpack_exports__["default"] = ("<div class='container'><br><br>\n<h1>Privacy and Confidentiality Policy</h1>\n<p>winorball (Reig Guy-C / Touverey Phil) (the \"Company\", \"us\" or \"us\") care about your privacy.\nThis Privacy Policy (\"Privacy Policy\") explains the Company's policies and procedures\nregarding the collection, use and disclosure of information and personal data that we receive from users\nof the website that we own and operate, namely http://winorball.com/ (the site \"). This privacy policy applies\nonly to information collected through the site.\nThis privacy policy is part of and is integrated into our general conditions of sale and use.\nBy visiting this site, you accept the policies and practices described in this privacy policy,\nas this privacy policy may be changed from time to time. Each time you visit the site, you expressly\naccept and consent to our collection, use and disclosure of the information you provide, as described in this privacy policy.\n</p><br><br>\n<h2>Collection of your personal information</h2>\n<p>The information we collect from you helps us personalize and improve the experience of users of our website. This information includes:<br>\n- Last name;<br>\n- First Name;<br>\n- E-mail adress;<br>\n- Paypal adress;<br>\nInformation about your use of our website may also be obtained through the use of \"cookies\".<br>\nWe will not collect sensitive information without your consent and will not collect any of this information secretly or dishonestly.\n</p><br>\n\n<h2>Use of your personal information</h2>\n<p>The primary use of your personal information is for the purposes listed above under the heading\nCollection of your personal information. However, we will use and disclose your personal information\nfor approved purposes and in various ways associated with approved purposes, including:<br><br>\nCommunicate with you;<br>\nAssist in the development of information technology, maintenance and development of systems;<br>\nAnalyze information for product development, marketing and research purposes and to improve and expand our range of products and services;<br>\nTo investigate and resolve complaints regarding the provision of services by us or by others associated with us;<br>\nMarketing directly to you;<br>\nDisclosure of your personal information to any other organization or person involved in the performance of any\nnecessary function or activity on our behalf, including handling complaints and preventing fraud;<br>\nDisclosure of your personal information in a manner authorized or required by law;<br>\nFor compliance with laws and regulations.\n</p><br>\n\n<h2>Disclosure of your personal information</h2>\n<p>\nWe may use and disclose your personal information for approved purposes and\nin various ways associated with approved purposes. This includes the following:\nWe may disclose personal information to third parties to allow outsourcing of\nfunctions. This will be done when this disclosure meets your reasonable expectations.\nWe will take reasonable steps to ensure that our contracts with third parties include\nrequirements that require third parties to comply with the usage and disclosure requirements in accordance with our privacy policy.\nWe may disclose personal information to law enforcement, government agencies, the courts\n or outside counsel when the law allows or requires it.\nWe may disclose personal information to avoid an imminent threat to the life of an individual or to public safety.\nWe do not sell or share the lists of users of our website on a commercial basis with third parties.</p><br>\n\n<h2>Information security</h2>\n<p>We will take reasonable steps to ensure the security of your personal information against risks such as loss or\nunauthorized access, destruction, use, modification or disclosure of data. We only allow access to your contact details\nto authorized personnel.</p><br>\n\n<h3>Secure transmission of your personal account details</h3>\n<p>We strive to protect your personal information during transmission. User account information provided through this site is\nkept in a secure server environment behind the Company's firewalls.\nAll personal information is transmitted using 128-bit secure server software (SSL), the latest industry standard encryption,\nto protect the loss, misuse or modification of your personal information under our control.</p><br>\n\n<h3>Cookies and other technologies</h3>\n<p>We use cookies and other technologies to help us determine which components of our website are most popular.\nCookies can also be used to study traffic patterns and, most importantly, to make sure that your experience of\ninteracting with us is practical.\nWe generally do not use this information collected for purposes beyond the scope of this privacy policy.\n</p><br>\n\n\n\n<h3>Unsubscribe from marketing communications</h3>\n<p>When you provide us with personal information from time to time, you may be asked to indicate\nif you would like to receive information from us about special offers related to the site and services.\nUnless you opt out of receiving such communications, we may from time to time send you marketing communications.\nAt any time, you can choose to stop receiving commercial or promotional emails from us by sending us an email.\nIn addition, in any promotional email we send, you will have the option to opt out of receiving such messages\nin the future by clicking on the link at the bottom of the email that says \"unsubscribe\".\n</p><br>\n\n<h3>Information for children</h3>\n<p>The Site is not intended or intended for children under the age of 18. We do not knowingly collect or solicit\npersonal information from anyone under the age of 18. If we obtain actual knowledge that a user is under the age\nof 18, we will take steps to delete that user's personal information from our systems.\n</p><br>\n\n<h3>Changes to this privacy policy</h3>\n<p>This privacy policy may change from time to time. These changes will be highlighted in this area at the time of the change.</p><br>\n\n<h2>Contact Us</h2>\n<p>If you have any questions or suggestions regarding the privacy or security of our site, please contact us by email.</p><br>\n\n<div class='text-center'><a routerLink=\"/login\">Back</a></div><br><br>\n</div>\n");

